import React, { Component } from 'react';
import {Card, CardBody, CardImg,Row, Col, Container} from 'reactstrap';
import Shipping from "../assets/images/ic_shipping.png";
import { connect } from 'react-redux';

class Content extends Component{
	constructor(props) {
		super(props);
		this.state = {}
		this.cardProduct = this.cardProduct.bind(this);
    }

    componentDidMount(){

    }

	cardProduct(obj){
		console.log(obj.query);
		var product = [];
		const pos = {img:"2", content:"10", info:"9", from:"2"}
		for(var i=0; i<20; i++){
			product.push(
				<Row className="separation">
					<Col xs={pos.img} sm={pos.img} md={pos.img} className="h-100 d-table no-gutter">
						<a href='/' className="d-table-cell align-middle prodImg">
							<CardImg src="https://http2.mlstatic.com/reloj-led-colores-D_NQ_NP_851720-MCO31042477337_062019-V.webp"/>
						</a>
					</Col>
					<Col xs={pos.content} sm={pos.content} md={pos.content} className="no-gutter h-100 d-table">
						<Row className="info">
							<Col xs={pos.info} sm={pos.info} md={pos.info}>
								<div className="price"><a href="#">$ 19.080</a> <div className="shipping"><CardImg width='100%' src={Shipping}/></div></div>
								<div>
									<div className="inf1">Apple Ipod Touch 5g 16gb Negro Igual A Nuevo</div>
									<div className="inf2">Completo Unico!</div>
								</div>
							</Col>
							<Col xs={pos.from} sm={pos.from} md={pos.from} className="d-table-cell align-bottom from">Capital Federal</Col>
						</Row>
					</Col>
				</Row>
			);
		}
		return product;
	}

	render(){
		return(
			<Card>
				{this.cardProduct(this.props.obj)}
			</Card>
		)	
	}
}

const mapStateToProps = (state) => {
    return{
        obj:state.ReducerSearch,
    }
}

const mapDispatchToProps = (dispatch) => {
	return {
        callDispatch:(type, self) => {
            dispatch({type: type, data: self });
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Content);
